//import logo from './logo.svg';
import './App.css';
import HomePage from "./HomePage";
import AboutPage from "./AboutPage";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route path="/about" component={AboutPage} />
          <Route path="/blog/:id" component={BlogPostPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
